import axios from 'axios'

const headers = {
    "Content-Type": "application/json",
    'Accept': 'application/json',
};

const baseUrl = "http://localhost:4000/api/article";

export default {

    getProfile : (headers) => {
    return axios.get(baseUrl + "/", headers)
    },

}
